      '16_Sound2/Main.tonyu': '$sound.playBGM($se_fuwa1, true);\n\ntime=new Actor{x:230,y:50,text:"Time=",size:20};\nvol=new Actor{x:230,y:80,text:"Vol=",size:20};\ntmp=new Actor{x:230,y:110,text:"Tempo=",size:20};\nprint("A-D: Sound Effect");\nprint("↑  ↓: Volume");\nprint("<-  ->: Tempo");\nprint("Z: Stop BGM");\n\nv=128;t=1;\nwhile (true) {\n    time.text="Time="+floor($sound.getBGMCurrentTime())+"sec";\n    if (getkey("up")) {\n        v++;if (v>128)v=128;\n        $sound.setBGMVolume(v);\n        vol.text="Vol="+v;\n    }\n    if (getkey("down")) {\n        v--;if (v<0)v=0;\n        $sound.setBGMVolume(v);\n        vol.text="Vol="+v;\n    }\n    if (getkey("left")) {\n        t-=0.01;//if (v>128)v=128;\n        $sound.setBGMTempo(t);\n        tmp.text="Tempo="+t;\n    }\n    if (getkey("right")) {\n        t+=0.01;//if (v<0)v=0;\n        $sound.setBGMTempo(t);\n        tmp.text="Tempo="+t;\n    }\n    \n    if (getkey("a")==1) {\n        $sound.playSE($se_fpon1);\n    }       \n    if (getkey("b")==1) {\n        $sound.playSE($se_putprop);\n    }       \n    if (getkey("c")==1) {\n        $sound.playSE($se_ret);\n    }       \n    if (getkey("d")==1) {\n        $sound.playSE($se_ftaki);\n    }\n    if (getkey("p")==1) {\n        $sound.playBGM($se_fuwa1, true);\n        \n    }\n    if (getkey("z")==1) {\n        $sound.stopBGM();\n    }\n    update();\n}',
